I$("581aea8eba37fbeab3de649d9bb368cc", '{#if priceDto.hasEnrollMicroSpec || priceDto.hasPaidSuccess}\n    <!-- 已购买 -->\n    <div class="btn-box">\n        <div class="hasBuy f-mhfbg">\n            <div class="f-vam">\n                <a class="ga-click v-ali-mid" target="_blank" href="//study.163.com/my#/smarts">\n                    {#if priceDto.price}\n                    <i class="f-mfc buy-status j-buyStatus ga-click">已购买，查看我的学习</i>\n                    {#else}\n                    <i class="f-mfc buy-status j-buyStatus ga-click">已报名，查看我的学习</i>\n                    {/if}\n                </a>\n            </div>\n        </div>\n    </div>\n{#elseif forbidEnroll == 1}\n    <!-- 报名结束 -->\n    <div class="btn-box">\n        <div class="buyOver f-fbg3">\n            <div class="f-vam">\n                <a class="ga-click v-ali-mid" style="cursor:default;">\n                    <i class="f-mhfc buy-status j-buyStatus ga-click">本期报名已结束</i>\n                </a>\n            </div>\n        </div>\n    </div>\n\n<!-- 活动期间 -->\n{#elseif isInActivity}\n\n    <!-- 预付定金阶段 -->\n    {#if !isInPayEnd}\n\n        <!-- 如果没预付定金 -->\n        {#if !priceDto.hasPaidDeposit}\n            <div class="btn-box">\n                <div class="payBook f-mhfbg" on-mouseover={ismourseover=true} on-mouseout={ismourseover=false}>\n                    <div class="f-vam">\n                        <a class="ga-click v-ali-mid" on-click={this.buyCourse(this.CONST.YOOC_DINGJINTYPE,priceDto.reservationInfoId)}>\n                            <i class="f-mfc buy-status j-buyStatus ga-click" r-class={{"f-mc": ismourseover}}>预付定金</i>\n                            <span class=" f-ffc buy-tips j-buyTips ga-click" r-class={{"f-mc": ismourseover}}>\n                            {priceDto.onPPBtnUnPay}\n                            </span>\n                        </a>\n                    </div>\n                </div>\n            </div>\n       <!--  活动预定期间已预付定金且开启购买功能  -->\n        {#elseif priceDto.groupBuyType == 1}\n            <div class="btn-box">\n                <div class="payEnd f-mhfbg" on-mouseover={ismourseover=true} on-mouseout={ismourseover=false}>\n                    <div class="f-vam">\n                        <a class="ga-click v-ali-mid" on-click={this.buyCourse(this.CONST.YOOC_COURSETYPE, priceDto.specId)}>\n                            <i class="f-mfc buy-status j-buyStatus ga-click" r-class={{"f-mc": ismourseover}}>支付尾款</i>\n                            <span class=" f-ffc buy-tips j-buyTips ga-click" r-class={{"f-mc": ismourseover}}>\n                            {priceDto.onPPBtnPaid}\n                            </span>\n                        </a>\n                    </div>\n                </div>\n            </div>\n\n        <!-- 活动预定期间已预付定金不开启购买功能 -->\n        {#else}\n            <div class="btn-box">\n                <div class="payBook f-mhfbg">\n                    <div class="f-vam">\n                        <a class="ga-click v-ali-mid" style="cursor:default;">\n                            <i class="f-mfc buy-status j-buyStatus ga-click" r-class={{"f-mc": ismourseover}}>预付成功</i>\n                            <span class=" f-ffc buy-tips j-buyTips ga-click" r-class={{"f-mc": ismourseover}}>\n                            {priceDto.onPPBtnPaid}\n                            </span>\n                        </a>\n                    </div>\n                </div>\n            </div>\n        {/if}\n\n    <!-- 尾款阶段 -->\n    {#else}\n    <div class="btn-box">\n        <div class="payEnd f-mhfbg" on-mouseover={ismourseover=true} on-mouseout={ismourseover=false}>\n            <div class="f-vam">\n                <a class="ga-click v-ali-mid" on-click={this.buyCourse(this.CONST.YOOC_COURSETYPE, priceDto.specId)}>\n                    <i class="f-mfc buy-status j-buyStatus ga-click" r-class={{"f-mc": ismourseover}}>{priceDto.hasPaidDeposit ? \'支付尾款\' : \'立即购买\'}</i>\n                    <span class=" f-ffc buy-tips j-buyTips ga-click" r-class={{"f-mc": ismourseover}}>\n                    {priceDto.hasPaidDeposit ? priceDto.pPBtnPaid : priceDto.pPBtnUnPay}\n                    </span>\n                </a>\n            </div>\n        </div>\n    </div>\n    {/if}\n\n<!-- 未在活动期间 -->\n{#else}\n<div class="btn-box">\n    <div class="buyNow f-mhfbd" r-class={{"f-mhfbg": ismourseover}} on-mouseover={ismourseover=true} on-mouseout={ismourseover=false}>\n        <div class="f-vam">\n            <a class="ga-click v-ali-mid" on-click={this.buyCourse(this.CONST.YOOC_COURSETYPE, priceDto.specId)}>\n                {#if priceDto.price}\n                <i class="f-mhfc buy-status j-buyStatus ga-click" r-class={{"f-mc": ismourseover}}>立即购买</i>\n                {#else}\n                <i class="f-mhfc buy-status j-buyStatus ga-click" r-class={{"f-mc": ismourseover}}>立即报名</i>\n                {/if}\n                {#if isHasActivityInfo && isBeforeBook && priceDto.beforePPBubbleBtn}\n                <span class=" f-mhfc buy-tips j-buyTips ga-click" r-class={{"f-mc": ismourseover}}>{priceDto.beforePPBubbleBtn}</span>\n                {/if}\n            </a>\n        </div>\n    </div>\n</div>\n{/if}\n');
